import LocationCard from './LocationCard'

function Hero({ entryDatas })
{
  const listItems = entryDatas.map((name) =>
    <li>
      {name}
    </li>
  );
  return (


    <>
      <ul>{listItems}</ul>
      {/* <LocationCard /> */}

    </>
  );
}

export default Hero;
